import './navbar.css';
import menuIcon from '../img/user_pic.png';

const NavBar = () => {
    return (
        <div className = "container">
            <div className= "con_logo">
                Appart
            </div>
            <div className="cont_login">
                <ul>
                    <img src={menuIcon} alt=""/>

                    <li>ContactUs</li>
                    <li>Login</li>

                </ul>

            </div>

        </div>
    );
};

export default NavBar;
